import React, { useState } from 'react';
import './Tickets.css'; // Optional: Create CSS for styling

const movies = [
  { id: 1, title: 'Movie 1', description: 'Action-packed thriller', rating: '4.5', price: 300 },
  { id: 2, title: 'Movie 2', description: 'Romantic comedy', rating: '4.2', price: 250 },
  { id: 3, title: 'Movie 3', description: 'Sci-fi adventure', rating: '4.8', price: 350 },
  { id: 4, title: 'Movie 4', description: 'Horror mystery', rating: '3.9', price: 270 },
  { id: 5, title: 'Movie 5', description: 'Animated family film', rating: '4.6', price: 290 },
];

const sports = [
  { id: 1, title: 'Football Match', description: 'Exciting football match', rating: '4.7', price: 500 },
  { id: 2, title: 'Cricket Match', description: 'Thrilling cricket game', rating: '4.5', price: 550 },
  { id: 3, title: 'Basketball Game', description: 'High-intensity basketball', rating: '4.3', price: 450 },
  { id: 4, title: 'Tennis Match', description: 'Competitive tennis game', rating: '4.4', price: 400 },
  { id: 5, title: 'Hockey Game', description: 'Fast-paced hockey match', rating: '4.6', price: 470 },
];

function Tickets() {
  const [cart, setCart] = useState([]);

  const addToCart = (item) => {
    setCart([...cart, item]);
    alert(`${item.title} added to cart`);
  };

  return (
    <div className="tickets-page">
      <h1>Tickets Page</h1>
      
      <div className="tickets-section">
        <h2>Movies</h2>
        <div className="tickets-list">
          {movies.map(movie => (
            <div key={movie.id} className="ticket-item">
              <h3>{movie.title}</h3>
              <p>{movie.description}</p>
              <p>Rating: {movie.rating}</p>
              <p>Price: ₹{movie.price}</p>
              <button onClick={() => addToCart(movie)}>Add to Cart</button>
            </div>
          ))}
        </div>

        <h2>Sports</h2>
        <div className="tickets-list">
          {sports.map(event => (
            <div key={event.id} className="ticket-item">
              <h3>{event.title}</h3>
              <p>{event.description}</p>
              <p>Rating: {event.rating}</p>
              <p>Price: ₹{event.price}</p>
              <button onClick={() => addToCart(event)}>Add to Cart</button>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default Tickets;
